#[test]
fn test_hex_padding() {
	assert_eq!(
		Vec::from_hex("00000000000000000000000000000000000000000000031636269e79627d57c9").unwrap(),
		Vec::from_hex(EthOffchain::hex_padding(64, "31636269e79627d57c9".as_bytes()).unwrap())
			.unwrap(),
	);
}

#[test]
fn url_decode() {
	let mut raw_url = ethscan_url::GTE_BLOCK.to_vec();
	raw_url.append(&mut base_n_bytes(9725369, 16));
	raw_url.append(&mut "&boolean=true&apikey=".as_bytes().to_vec());
	let url = core::str::from_utf8(&raw_url).unwrap();
	assert_eq!(
		url,
		"https://api.etherscan.io/api?module=proxy&action=eth_getBlockByNumber&tag=0x9465B9&boolean=true&apikey=",
	);
}

#[test]
fn test_build_eth_header_info() {
	// the header info of eth gensis block
	// 2020-03-17 10:38:56 [eth-offchain] current block hight: 9686404
	// 2020-03-17 10:38:57 [eth-offchain] total difficulty: "0x31636269e79627d57c9"
	// 2020-03-17 10:38:57 [eth-offchain] parent hash "0xa0aa7515b248430c5edd9e58b475acedfe09d9ddcf0e7351aaaa0d31311de8fd"

	let total_difficulty =
		"00000000000000000000000000000000000000000000031636269e79627d57c9".as_bytes();
	assert_eq!(total_difficulty.len(), 64);
	let total_difficulty = <[u8; 32]>::from_hex(total_difficulty).unwrap().into();

	let parent_hash = "a0aa7515b248430c5edd9e58b475acedfe09d9ddcf0e7351aaaa0d31311de8fd".as_bytes();
	assert_eq!(parent_hash.len(), 64);
	let parent_hash = <[u8; 32]>::from_hex(parent_hash).unwrap().into();

	let header_info = EthOffchain::_build_eth_header_info(
		1u64,
		"31636269e79627d57c9".as_bytes(),
		"a0aa7515b248430c5edd9e58b475acedfe09d9ddcf0e7351aaaa0d31311de8fd".as_bytes(),
	)
	.unwrap();

	assert_eq!(
		(header_info.total_difficulty, header_info.parent_hash),
		(total_difficulty, parent_hash),
	);
}

#[test]
fn test_build_eth_seal() {
	let mix_hash_hex =
		"efe7ec97ca708ad6b369e4d98239eea75ba23dd18165d018e74535aaa0e11397".as_bytes();
	assert_eq!(mix_hash_hex.len(), 64);
	let mix_hash = <[u8; 32]>::from_hex(mix_hash_hex).unwrap().into();

	let nonce_hex = "357af99003a60e5c".as_bytes();
	assert_eq!(nonce_hex.len(), 16);
	let nonce = <[u8; 8]>::from_hex(nonce_hex).unwrap().into();

	let seal = EthOffchain::build_eth_seal(
		"efe7ec97ca708ad6b369e4d98239eea75ba23dd18165d018e74535aaa0e11397".as_bytes(),
		"357af99003a60e5c".as_bytes(),
	)
	.unwrap();

	assert_eq!((seal.mix_hash, seal.nonce), (mix_hash, nonce));
}

